import React from 'react';
import './App.css';
import Login from './componentes/Login';
import Header from "./componentes/Header";

class App extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            fname: '',
            lname: '',
            email: '',
            message: '',
        }
    }
    render () {
        return (
            <div>
                <Header className="App-header" />
                <Login  />
            </div>
        );
    }
}

export default App;
